import React from 'react'
import NavBar from '../../components/NavBar/NavBar'
import ContactUs from '../../components/ContactUs/ContactUs'
import './Contact.css'

const Contact = () => {
  return (
    <div className="Contact">
      <NavBar/> 
      <ContactUs/> 
    </div>
    );
}
        
export default Contact
